QUnit.begin=function(){console.log("Starting test suite");console.log("======\n")};QUnit.moduleDone=function(a){if(a.failed===0){console.log("\u2714 All tests passed in '"+a.name+"' module")}else{console.log("\u2716 "+a.failed+" tests failed in '"+a.name+"' module")}};QUnit.done=function(a){console.log("\n======");console.log("Tests completed in "+a.runtime+" milliseconds");console.log(a.passed+" tests of "+a.total+" passed, "+a.failed+" failed.")};